contracts/AuctionEstate.sol.content:
// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract AuctionEstate is ERC1155,IERC1155Receiver {

    uint256 private estateId;
    uint256 private estateEvaluation;
    uint256 private highestBid;
    address payable private auctionWinner;
    uint256 private timestamp;
    address payable private estateOwner;

    address payable [] private bidders;
    
    mapping (address=>uint256) private BidsPlaced;


    constructor(uint256 _id,uint256 _evaluation,uint256 _timestamp,address payable owner)
        ERC1155("")
    {   estateId = _id;
        estateEvaluation = _evaluation;
        timestamp = _timestamp;
        highestBid = 0;
        estateOwner = owner;
    }

    function getAuctionDetails() external view returns(uint256,uint256,uint256,address payable,address payable,uint256){
        return(estateId,estateEvaluation,highestBid,estateOwner,auctionWinner,timestamp);
    }

    function getAllBidders() external view returns(address payable [] memory){
        return bidders;
    }

    function getBidDetails(address payable bidder) external view returns(uint256){
        return (BidsPlaced[bidder]);
    }

    function placeBid(uint256 bid) external payable  {
        //require(block.timestamp - timestamp <= 24 hours,"This listing has expired");
        require(bid>estateEvaluation, "Bid placed must be higher than the evaluation of the timestamp");
        BidsPlaced[msg.sender] = bid;
        bidders.push(payable(address(msg.sender)));
        if(highestBid<bid){
            highestBid = bid;
            auctionWinner = payable(address(msg.sender));
        }
    }

    function declareWinner() public view returns(address payable) {
        //require(block.timestamp-timestamp> 24 hours, "Winner cannot be declared before 24 hours of the listing");
        return auctionWinner;
    }

    function withdrawMyFunds() external payable {
        //require(block.timestamp-timestamp> 24 hours, "Funds cannot be withdrawn before 24 hours of the listing");
        if(payable(address(msg.sender))!=auctionWinner){
            uint256 bidPlaced = BidsPlaced[msg.sender];
            require(bidPlaced!=0 , "You have not placed any bet in this auction");
            payable(address(msg.sender)).transfer(bidPlaced);
            BidsPlaced[address(msg.sender)] = 0;
        }
    }

    function claimPrize() external payable {
        //require(block.timestamp-timestamp> 24 hours, "Estate cannnot be claimed before 24 hours of the listing");
        if(payable(address(msg.sender))==auctionWinner){
            estateOwner.transfer(highestBid);
            safeTransferFrom(address(this), auctionWinner, estateId, 0, "");
            BidsPlaced[address(msg.sender)] = 0;
        }  
    }

    function onERC1155Received(address, address, uint256, uint256, bytes memory) public virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(address, address, uint256[] memory, uint256[] memory, bytes memory) public virtual returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }

    // The following functions are overrides required by Solidity.

}

contracts/FactoryEstate.sol.content:
// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Create2.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "./AuctionEstate.sol";
import "./WalletEstate.sol";

contract EstateFactory is ERC1155,IERC1155Receiver{

    uint256 private _nextTokenId=1;

    constructor()
        ERC1155("")        
    {}

    struct Estate{
        uint256 estateID;
        address payable estateOwner;
        uint256 estateEvaluation;
        string estateMetadata;
        bool isListedForAuction;
        bool isListedForInvestment;
    }

    mapping (uint256 => Estate) private Estates;
    mapping (uint256 => address) private EstateInvestmentListings; //estate id -> estate wallet contract address
    mapping (uint256 => address) private EstateAuctionListings; //estate id -> estate auction contract address

    function tokenizeEstate(string memory _metadata,uint256 _evaluation) external  {
        require(_evaluation>0, "Evaluation of the Estate must be more than zero!");
        address payable addr = payable(address(msg.sender));
        //Mint Estate Token to Owner

         uint256 tokenId = _nextTokenId;
        _nextTokenId++;
        mint(addr,tokenId,1,"");
        setURI(_metadata);

        //Create Estate Listing
        Estates[tokenId] = Estate({
            estateID:tokenId,
            estateOwner: payable(address(msg.sender)),
            estateMetadata:_metadata,
            estateEvaluation: _evaluation,
            isListedForAuction:false,
            isListedForInvestment:false
        });

    }

    function listEstateForAuction(uint256 estateId) external {
        bytes32 _salt = keccak256(abi.encodePacked(block.timestamp, msg.sender));
        address latestAuctionAddress = Create2.deploy(0,_salt, abi.encodePacked(type(AuctionEstate).creationCode, abi.encode(estateId,Estates[estateId].estateEvaluation,block.timestamp,Estates[estateId].estateOwner))
        );
        safeTransferFrom(msg.sender,latestAuctionAddress, estateId, 1, "");
        EstateAuctionListings[estateId] = latestAuctionAddress;
        Estates[estateId].isListedForAuction = true;
    }

     function listEstateForInvestment(uint256 estateId) external  {

        IERC1155Receiver newContract = new WalletEstate(estateId,Estates[estateId].estateEvaluation);
        safeTransferFrom(msg.sender,address(newContract), estateId, 1, "");
        _mint(address(msg.sender), 0, 100, "");
         safeTransferFrom(msg.sender,address(newContract), 0, 100, "");

        EstateInvestmentListings[estateId] = address(newContract);
        Estates[estateId].isListedForInvestment = true;

    }

    function getEstateListing(uint256 estateId) external view returns (Estate memory) {
        return Estates[estateId];
    }

    function getEstateInvestmentListing(uint256 estateId) external view returns (address) {
        return EstateInvestmentListings[estateId];
    }

    function updateOwner(uint256 estateID,address payable newOwner) external {
        Estates[estateID].estateOwner = newOwner;
        Estates[estateID].isListedForAuction = false;
        Estates[estateID].isListedForInvestment = false;
    }

    function getEstateAuctionListing(uint256 estateId) external view returns (address) {
        return EstateAuctionListings[estateId];
    }

    function getNumEstates() external view returns (uint256) {
        return _nextTokenId;
    }

    function setURI(string memory newuri) private {
        _setURI(newuri);
    }

    function mint(address account, uint256 id, uint256 amount,bytes memory data) private
    {
        _mint(account, id, amount,data);
    }

    function mintBatch(address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
        private

    {
        _mintBatch(to, ids, amounts, data);
    }

     function onERC1155Received(address, address, uint256, uint256, bytes memory) public virtual override returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(address, address, uint256[] memory, uint256[] memory, bytes memory) public virtual override returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC1155, IERC165) returns (bool) {
        return interfaceId == type(IERC1155Receiver).interfaceId || super.supportsInterface(interfaceId);
    }





}

contracts/WalletEstate.sol.content:
// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


contract WalletEstate is ERC1155,IERC1155Receiver {

    uint256 private constant WALLET_TOKEN = 0;
    uint256 private estateId;
    uint256 private estateEvaluation;
    address payable private estateOwner;

    mapping (address=>uint256) estateShareHolders;

    address payable [] private investors;

    constructor(uint256 _id,uint256 _evaluation)
        ERC1155("")
    {   estateId = _id;
        estateEvaluation = _evaluation;
        estateOwner = payable(address(msg.sender));
        
    }

     function getInvestmentDetails() external view returns(uint256,uint256,address payable){
        return(estateId,estateEvaluation,estateOwner);
    }

    function getAllInvestors() external view returns(address payable [] memory){
        return investors;
    }

    function getInvestmentDetails(address payable investor) external view returns(uint256){
        return (estateShareHolders[investor]);
    }

    function purchaseShares(uint256 quantity) external payable  {
        require(quantity<=100,"Maximum number of shares that can be purchased is 100");
        require(quantity>0, "Number of shares purchased cannot be zero or less");
        require(quantity<balanceOf(address(this), WALLET_TOKEN),"There aren't sufficient shares to be purchased");

        //uint256 share_evaluation = ((estateEvaluation*10**18)/100)*quantity;
        //require(share_evaluation==msg.value,"Incorrect funds sent!");
        payable(address(this)).transfer(msg.value);

       safeTransferFrom(address(this), address(msg.sender), WALLET_TOKEN, quantity, "");
       estateShareHolders[address(msg.sender)] = quantity;
       investors.push(payable(address(msg.sender)));
    }

    function transferShares(address receiver,uint256 quantity) external {
        require(quantity <= estateShareHolders[address(msg.sender)], "Insufficient shares to be transferred to recepient");
        safeTransferFrom(address(msg.sender), receiver, WALLET_TOKEN, quantity, "");
        estateShareHolders[address(msg.sender)] -= quantity;
        estateShareHolders[receiver] += quantity;
    }

    function sellShares(uint256 quantity) external payable {
        require(quantity <= estateShareHolders[address(msg.sender)], "Insufficient shares to be sold");
        safeTransferFrom(address(msg.sender), address(this), WALLET_TOKEN, quantity, "");

        uint256 share_evaluation = ((estateEvaluation*10**18)/100)*quantity;
        payable(address(msg.sender)).transfer(share_evaluation);
        estateShareHolders[address(msg.sender)] -=quantity; 
    }

    function onERC1155Received(address, address, uint256, uint256, bytes memory) external virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }

    function onERC1155BatchReceived(address, address, uint256[] memory, uint256[] memory, bytes memory) external virtual returns (bytes4) {
        return this.onERC1155BatchReceived.selector;
    }

}

